XWiki can be set-up to support one or various languages. As of September 2011 XWiki Enterprise supports 25 languages:
* Catalan (ca) * Chinese, Simplified (zh) * Chinese, Traditional (zh_TW) * Croatian (hr) * Czech (cs) * Dutch (nl) * English (en) * French (fr) * Galician (gl) * German (de) * Hindi (hi) * Hungarian (hu) * Italian (it) * Korean (ko) * Latvian (lv) * Norwegian (no) * Polish (pl) * Portuguese (pt) * Romanian (ro) * Russian (ru) * Slovak (sk) * Spanish (es) * Swedish (sv) * Ukrainian (uk) * Vietnamese (vi)
To see the exact status for each language or if you wish to help, check our [[translation wiki>>http://l10n.xwiki.org/xwiki/bin/view/L10N/]] (for example you can see the [[status of translations for XWiki Enteprise>>http://l10n.xwiki.org/xwiki/bin/view/XE/XWikiCoreResources]]).
= Preferences =
Setting up languages is done in the Administration (link on the top left of every page).
{{info}}To make use of this feature for Languages with encodings that are not ISO-8859-1, you will need to adjust the encoding for your XWiki setup as documented in the [[Encodings page of the Administrators Guide>>platform:AdminGuide.Encoding]].{{/info}}
{{image reference="Features.I18N@AdminLanguages.png"/}}
= Switch to another language =
By default the language displayed will be the one coming from the browser. However, on every page you can choose to switch between the different language translations that exist for that page. To do so click on the language name in the top right corner of the screen as shown in the following screenshots. Note that you can also force a language by suffixing a URL with ##language=<2-letter language code>##. In addition you can [[configure your wiki to always use a specific language or force a single language to be used>>AdminGuide.Configuration#HLanguagesettings]].
{{image reference="Features.I18N@LanguageEN.png"/}} <-//English// //Deutsch//-> {{image reference="Features.I18N@LanguageDE.png"/}}
//For the Mandriva Club website (the club no longer exists), XWiki supported 26 languages:
{{image reference="Features.I18N@Languages_MandrivaClub.JPG"/}}
{{info}}Once you click on a language, you're forcing it and thus all pages which have translations in that language will display these translations by default when you navigate to them.{{/info}}
= Edit a translation =
When you go to the edition mode you are able to edit the page in the default language. The default language is indicated on the right "Document Information" panel as shown below:
{{image reference="Features.I18N@DefaultLanguageEN.PNG"/}}
In the "Document Translations" panel you can see the current language you are performing translations in and the alternative languages you may translate your page to. These are the languages you have previously set up in "Administration".
{{image reference="Features.I18N@DocumentTranslations.PNG"/}}
In order to translate your document in a different language, click on one of the languages (e.g. Fr). As a result you will see the edition mode translated in that language.
{{image reference="Features.I18N@DefaultLanguageFR.PNG"/}}
Once you save a document in one of the languages, that document becomes the original document and the language it is written in becomes the default language.
{{image reference="Features.I18N@OriginalLanguage.PNG"/}}
{{info}}Note that all translations of one page share the same set of XWiki objects. As a result it is impossible to have different objects (and page tags, which are objects too) in different translations for now, but it is planed in next versions.{{/info}}
